import React from "react";

const EvenOddPage = () => {
  const evenodd_arr = [
    "Javascript",
    "React",
    "Css",
    "Html",
    "Java",
    "Data Structures and Algorithm",
  ];
  return <ul>{evenodd_arr.map()}</ul>;
};

export default EvenOddPage;
